import React,{useState} from 'react'
import { Button, Typography, Container } from '@material-ui/core'
import {makeStyles} from '@material-ui/core/styles'
import './User.css'
import AdminLink from './AdminLinks';
import AdminForm from './AdminForm';
import PopUp from '../../control/PopUp'
import UserList from './UserList';

const useStyles= makeStyles((theme)=>({
    root:{
        marginTop:"80px"
    },
    heading:{
           float:"left",
           fontSize:"20px",
           marginTop:"15px",
           marginLeft:"10px",
           fontWeight:"700",
           color:"#133b5c"
   }, 
}))

function User() {
    const classes = useStyles();
    const [openPopup,setOpenPopup] = useState(false);
    return (
        <>      
               <AdminLink/>
                <Container>
                <div className={classes.root}>
                        <Typography variant="h4" className={classes.heading}>User Details</Typography> 
                    <div className="wrapper-inner-tab-backgrounds-second">
                        <div className="sim-button button13" onClick={ ()=> setOpenPopup(true)} ><span>Add User</span></div>
                    </div>    
                </div>            
                <UserList/>
                <PopUp
                    openPopup={openPopup}
                    setOpenPopup={setOpenPopup}
                    maxWidth="sm"
                    >
                        <AdminForm/>
                </PopUp>

                </Container>
        </>
    )
}

export default User;
